\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Již tradičně na\r\nzačátku března startují ve stejný termín dva významné etapové závody. Již včera\r\nzačal ve Francii závod Paris - Nice. Hned v pondělí 10. března odstartoval i\r\nitalský etapák Tirreno Adriatico. Ten zahájila 11,5km dlouhá časovka, která\r\nměla jednoho jasného favorita. Ital Filippo Ganna v jízdě proti času patří do\r\nnaprosté světové špičky, což potvrdil i dnes, když suverénně ovládl úvodní\r\netapu.</b></p>\r\n\r\n<p class=\"MsoNormal\">Na start úvodní <b style=\"mso-bidi-font-weight:normal\">časovky\r\nTirrena Adriatica roku 2025</b> se postavilo 166 závodníků. Jako jeden z prvních\r\nse na chronometr v toskánském městě Camaiore <b style=\"mso-bidi-font-weight:\r\nnormal\">vydal Dán Johan Price-Pejtersen z týmu Alpecin Deceunick.</b> Ten na\r\nmezičase zaznamenal průběžné vedení. To udržel až do cíle, který protnul v čase\r\n12min 45s. Díky tomuto času se <b style=\"mso-bidi-font-weight:normal\">Dán\r\ndlouho ohříval v křesle pro průběžně vedoucího závodníka</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Čas Dána Pejtersena <b style=\"mso-bidi-font-weight:normal\">pokořil\r\naž Španěl Juan Ayuso</b>, který startoval třináctý od konce. Závodník týmu UAE\r\nEmirates XRG zaznamenal na mezičase vůbec nejrychlejší čas dne. Ayuso nastolené\r\ntempo udržel až do cíle, kde se jeho <b style=\"mso-bidi-font-weight:normal\">čas\r\nzastavil na hodnotě o pět sekund nižší, než byl do té chvíle nejlepší čas</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Jako třetí od konce se na svůj souboj proti času <b style=\"mso-bidi-font-weight:normal\">vydal domácí favorit Filippo Ganna</b>. Ten\r\nzačátek rozjel pozvolně, když na mezičase zaostal dvě sekundy za Ayusem. Pak\r\nale Ital ukázal svou extra třídu, když postupně začal zrychlovat. <b style=\"mso-bidi-font-weight:normal\">Do cíle doslova doletěl v čase 12:17</b>,\r\nčímž o 23 sekund překonal výkon v tu chvíli vedoucího Ayusa. <b style=\"mso-bidi-font-weight:normal\">Ganna tratí jako jediný prosvištěl tratí\r\nprůměrnou rychlostí přes 56km/h</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Ganna se už před startem závodu nechal slyšet, že <b style=\"mso-bidi-font-weight:normal\">pomýšlí na celkové vítězství</b>. Letošní\r\nročník Tirrena Adriatica obsahuje pouze 2 vrchařské etapy. Navíc tento Ital v\r\npředsezónní přípravě na ostrově Grand Canaria <b style=\"mso-bidi-font-weight:\r\nnormal\">intenzivně pracoval na svých vrchařských dovednostech</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Ganna si v první etapě vytvořil slibný náskok na favority na\r\ncelkové pořadí. Ti se ale rozhodně nenechali zahanbit. Především <b style=\"mso-bidi-font-weight:normal\">trojice Ayuso, Gee a Tiberi zaznamenala\r\ntakovou ztrátu, kterou by ve dvou horských etapách mohli stáhnout.</b> Vše ale\r\nbude záviset na Gannových výkonech.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p><p class=\"MsoNormal\">Kompletní výsledky naleznete <b><a href=\"https://www.procyclingstats.com/race/tirreno-adriatico/2025/stage-1\" target=\"_blank\">ZDE</a></b></p><p></p><p></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Myslíte si, že Ganna\r\nmůže celkově zvítězit?</b></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">zdroj obrázků: facebook.com/highlightsofcycling</p>\r\n\r\n<div><br></div>        ', 6, 'ganna-v-uvodni-casovce-tirrena-adriatica-deklasoval-vsechny-soupere-a-je-celkovym-lidrem');